                    icon: 'list',
                    title: 'KiemKe',
                    link: '/kiemke',
                },
                {
                    icon: 'list',
                    title: 'KhachHang',
                    link: '/khachhang',
                },
                {
                    icon: 'list',
                    title: 'LoaiPhong',
                    link: '/loaiphong',
                },
                {
                    icon: 'list',
                    title: 'NhanVien',
                    link: '/nhanvien',
                },
                {
                    icon: 'list',
                    title: 'PhieuNhapKho',
                    link: '/phieunhapkho',
                },
                {
                    icon: 'list',
                    title: 'Phong',
                    link: '/phong',
                },
                {
                    icon: 'list',
                    title: 'sysdiagrams',
                    link: '/sysdiagrams',
                },
                {
                    icon: 'list',
                    title: 'ThuePhong',
                    link: '/thuephong',
                },
                {
                    icon: 'list',
                    title: 'VatDung',
                    link: '/vatdung',
                },
                {
                    icon: 'list',
                    title: 'VatDungPhong',
                    link: '/vatdungphong',
                },
            ],
            miniVariant: false,
            right: true,
            rightDrawer: false,
            title: 'Title',
            user: {} as any
        };
    },
    computed: {
        isLoggedIn(): boolean {
            this.user = store.state.user.Profile
            return store.state.user
                && store.state.user.AccessToken
                && store.state.user.AccessToken.IsAuthenticated;
        }
    },
    created() {
         this.$eventBus.$emit('getSoKhachDatPhong');
         this.$eventBus.$emit('getSoKhachDatDichVu');
    },
    methods: {
        show() {
            store.state.app.showLeftSideBar = !store.state.app.showLeftSideBar
        },
        logout() {
            auth.logout();
        },
    }
});
